import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 2.2-5512 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-5512.md","filePath":"vacode/2.2-5512.md"}'),r={name:"vacode/2.2-5512.md"},i=o('<h1 id="§-2-2-5512-definitions" tabindex="-1">§ 2.2-5512 Definitions. <a class="header-anchor" href="#§-2-2-5512-definitions" aria-label="Permalink to &quot;§ 2.2-5512 Definitions.&quot;">​</a></h1><p>As used in this chapter:</p><p>&quot;Commercial activity&quot; means an activity performed by or for state government that is not an inherently governmental activity and that may feasibly be obtained from a commercial source at lower cost than the activity being performed by state employees.</p><p>&quot;Commercial source&quot; means any business or other private concern that is eligible for contract awarded in accordance with the Public-Private Education and Infrastructure Act of 2002 (§ <a href="http://law.lis.virginia.gov/vacode/56-575.1/" target="_blank" rel="noreferrer">56-575.1</a> et seq.) or the Virginia Public Procurement Act (§ <a href="http://law.lis.virginia.gov/vacode/2.2-4300/" target="_blank" rel="noreferrer">2.2-4300</a> et seq.).</p><p>&quot;State employee&quot; means all persons employed by the Commonwealth to provide services, including both salaried and wage employees, and all persons engaged to perform work for or to provide services to the Commonwealth.</p><p>2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0994" target="_blank" rel="noreferrer">994</a>.</p>',6),n=[i];function s(c,l,d,p,m,h){return t(),a("div",null,n)}const u=e(r,[["render",s]]);export{f as __pageData,u as default};
